import './Calculator.css'
import React , {Component} from 'react'

import Button from '../components/Button'

export default class Calculator extends Component {
    render() {
        return (
            <div className="calculator">
                <Button label="AC"/>
                <Button label="/"/>
                <Button label="7"/>
                <Button label="8"/>
                <Button label="9"/>
            </div>
        )
    }
}
